import React, {Component} from 'react';

class TodoItem extends Component {
    render() {        
        return (
            <div className="TodoItem">
                <p>{this.props.title}</p>   
                <h2>{this.props.ahihi}</h2>            
            </div>
        );
    }
}
export default TodoItem;
